<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8"/>
  <link rel="icon" href="%PUBLIC_URL%/favicon.ico"/>
  <meta name="viewport" content="width=device-width, initial-scale=1"/>
  <meta name="theme-color" content="#000000"/>
  <meta
    name="description"
    content="Web site created using create-react-app"
  />
  <link rel="apple-touch-icon" href="logo192.png"/>
  <title>Swagger</title>
  <link href="/dist/latest/app/main.bundle.css" rel="stylesheet"/>
</head>
<body>
<noscript>You need to enable JavaScript to run this app.</noscript>

<script>
  window.SwaggerUIConfiguration = {
    brandName: 'ClubMed',
    appName: 'Example',
    url: 'https://api.clubmed.com/doc/swagger.json',
    filter: true,
    plugins: [
      'SidebarPlugin',
      'TopbarPlugin',
      'AuthorizeBtnPlugin',
      'StandaloneLayoutPlugin',
      'OperationsPlugin',
      'OAuth2Plugin',
      'HighlightPlugin',
      'DownloadUrl'
    ],
    layout: 'StandaloneLayout',
    deepLinking: true
  }
</script>

<div id="root"></div>

<script src="/dist/latest/app/main.bundle.js" type="application/javascript"></script>
